import { Switch } from 'react-router-dom'
import { MainLayout } from './layout'
import {
    Home, About
} from './pages'

const Routes = () => {
    return (
        <Switch>
            <RouteWithLayout
                path='/home'
                exact
                layout={MainLayout}
                component={Home}
            />
            <RouteWithLayout
                path='/about'
                exact
                layout={MainLayout}
                component={About}
            />
        </Switch>
    )
}
